import React from 'react';
import { Routes, Route } from 'react-router-dom';
import HomePage from './pages/HomePage';

function App() {
  return (
    <Routes>
      <Route path="/" element={<HomePage />} />
      <Route path="/doonies" element={<div className="h-screen flex items-center justify-center text-white text-2xl">Doonies Avatar Builder Page (Coming Soon)</div>} />
    </Routes>
  );
}

export default App;
